import React from 'react';

const Navigation = ({onRouteChange, isSingedIn}) => 
{
		if (isSingedIn) {
			return (
		<nav style={{display:'flex', justifyContent: 'flex-end'}}>
		<p onClick={() => onRouteChange('signin')} className='f3 link dim yellow pa3 pointer'> Sign out </p>
		</nav> );
		} else {
			return (
		<nav style={{display:'flex', justifyContent: 'flex-end'}}>
		<p onClick={() => onRouteChange('sign in')} className='f3 link dim yellow pa3 pointer'> Sign in</p>
		<p onClick={() => onRouteChange('register')} className='f3 link dim yellow pa3 pointer'> Register </p>
		</nav>
		);
		}

}

export default Navigation;
